import React, { Component } from "react";
import "./Button.css";

function Btn(props) {
  return (
    <input
      type="button"
      className="btn" // Replace with the appropriate class name
      value={props.name}
    />
  );
}

class Button extends Component {
  render() {
    return <Btn name={this.props.name} />;
  }
}

export default Button;
